import { AppBar, ToolBar, Typography } from "@mui/material";
import { Container } from "@mui/system";
import React from "react";

export default function Layout() {
  return (
    <>
    <AppBar>
      <ToolBar sx={{ width: 640, m: "auto" }}>
        <Typography variant="h4" align="center">
          Quiz App
        </Typography>
      </ToolBar>
    </AppBar>
    <Container>
        <Outlet/>
    </Container>
    </>
  );
}
